import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    const initialShot = path.join(screenshotsDir, 'step_1_initial.png');
    await page.screenshot({ path: initialShot });
    screenshots.push(initialShot);

    // Open a product modal by clicking a product card (use nth-of-type to avoid text selectors)
    await page.waitForSelector('.product-card', { timeout: 5000 });
    const productCards = await page.$$('.product-card');
    if (productCards.length === 0) throw new Error('No product cards found');
    await productCards[0].click();

    // Wait for modal to appear (modal has id 'productModal' and style.display='block')
    await page.waitForSelector('#productModal', { timeout: 5000 });
    // Ensure modal is visible
    await page.waitForFunction(() => {
      const modal = document.getElementById('productModal');
      return modal && window.getComputedStyle(modal).display !== 'none';
    }, { timeout: 5000 });

    // Take screenshot with modal open
    const modalOpenShot = path.join(screenshotsDir, 'step_2_modal_open.png');
    await page.screenshot({ path: modalOpenShot });
    screenshots.push(modalOpenShot);

    // Press Escape key to close modal
    await page.keyboard.press('Escape');

    // Wait for modal to be hidden
    await page.waitForFunction(() => {
      const modal = document.getElementById('productModal');
      return modal && window.getComputedStyle(modal).display === 'none';
    }, { timeout: 5000 });

    // Take screenshot after modal closed
    const modalClosedShot = path.join(screenshotsDir, 'step_3_modal_closed.png');
    await page.screenshot({ path: modalClosedShot });
    screenshots.push(modalClosedShot);

    // Extract modal visibility state to verify
    const modalVisible = await page.evaluate(() => {
      const modal = document.getElementById('productModal');
      return modal && window.getComputedStyle(modal).display !== 'none';
    });

    return {
      success: true,
      action: "Opened a product modal and closed it using Escape key",
      extractedData: {
        modalVisibleAfterEscape: modalVisible
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
